import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function AdminDashboard() {
  const [docs, setDocs] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  useEffect(() => {
    fetchDocs();
  }, []);

  const fetchDocs = async () => {
    setLoading(true);
    try {
      const res = await axios.get('/api/admin/documents', {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      setDocs(res.data);
    } catch (err) {
      setError('Failed to fetch documents');
    }
    setLoading(false);
  };

  const handleUpdate = async (docId, is_viewed, admin_comment) => {
    setLoading(true);
    try {
      await axios.put(`/api/admin/documents/${docId}`, { is_viewed, admin_comment }, {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      setSuccess('Updated!');
      fetchDocs();
    } catch (err) {
      setError('Update failed');
    }
    setLoading(false);
  };

  return (
    <div className="min-h-screen bg-gray-50 p-4">
      <div className="max-w-3xl mx-auto">
        <div className="flex justify-between items-center mb-4">
          <h2 className="text-2xl font-bold">Admin Dashboard</h2>
          <a href="/admin/deadline" className="bg-blue-500 text-white px-4 py-2 rounded">Set Deadline</a>
        </div>
        {error && <div className="text-red-500 mb-2">{error}</div>}
        {success && <div className="text-green-500 mb-2">{success}</div>}
        {loading ? <div>Loading...</div> : (
          <table className="w-full bg-white rounded shadow">
            <thead>
              <tr>
                <th className="p-2">User</th>
                <th className="p-2">Title</th>
                <th className="p-2">Uploaded</th>
                <th className="p-2">Viewed</th>
                <th className="p-2">Comment</th>
                <th className="p-2">File</th>
                <th className="p-2">Action</th>
              </tr>
            </thead>
            <tbody>
              {docs.map(doc => (
                <tr key={doc.id}>
                  <td className="p-2">{doc.user_name}</td>
                  <td className="p-2">{doc.title}</td>
                  <td className="p-2">{new Date(doc.upload_datetime).toLocaleString()}</td>
                  <td className="p-2">
                    <input type="checkbox" checked={doc.is_viewed} onChange={e => handleUpdate(doc.id, e.target.checked, doc.admin_comment)} />
                  </td>
                  <td className="p-2">
                    <textarea value={doc.admin_comment || ''} onChange={e => handleUpdate(doc.id, doc.is_viewed, e.target.value)} className="border p-1 rounded w-32" />
                  </td>
                  <td className="p-2">
                    <a href={`/api/documents/download/${doc.id}`} target="_blank" rel="noopener noreferrer" className="text-blue-500 underline">Download</a>
                  </td>
                  <td className="p-2">
                    <button className="bg-green-500 text-white px-2 py-1 rounded" onClick={() => handleUpdate(doc.id, doc.is_viewed, doc.admin_comment)}>Save</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}
